A sndrome do pnico  um tipo de transtorno de ansiedade no qual ocorrem crises inesperadas de desespero e medo intenso de que algo ruim acontea, mesmo que no haja motivo algum para isso ou sinais de perigo iminente.

As crises de medo agudo so recorrentes e inesperadas, seguidas de preocupao persistente com a possibilidade de ter novos ataques e com as consequencias desses ataques, seja dificultando a rotina do dia a dia, seja por medo de perder o controle, enlouquecer ou ter um ataque no corao.

So crises muito intensas, caracterizadas por:
- ansiedade;
- palidez;
- suor intenso;
- falta de ar;
- palpitaes;
- tonturas;
- tremores;
- desmaio;
- sensao de morte.

As crises de pnico tendem a ocorrer em quaisquer lugares, sem aviso prvio. Tem uma durao mdia de 10 a 20 minutos, mas pode variar de pessoa para pessoa, alm disso alguns sintomas podem ser sentidos horas depois da crise passar.

O medo de reviver a crise  to grande, que a pessoa ir evitar qualquer situao ou local que a faa sentir novamente aquela sensao, em casos mais extremos, pode-se desenvolver problemas mais srios como depresso, alcoolismo e outros.

Na hora do ataque  importante tentar controlar a respirao, buscar distrair a mente com conversas e msicas e praticar tcnicas de relaxamento como meditao e massagens. Tambm  interessante se mover para um ambiente mais tranquilo, arejado e seguro.

O fundamental, no entanto,  tentar encontrar a origem desse sentimento.  preciso afastar do indivduo o medo e a ansiedade dessas situaes e pensamentos que esto gerando os ataques. Para isso, deve-se contar com a ajuda de medicamentos antidepressivos e, principalmente, da orientao psicolgica.

Atravs do tratamento  possvel amenizar as crises, bem como reduzir suas frequncias e at mesmo “curar” o paciente, mantendo a situao totalmente sob controle.

